import React from "react";
import { Grid, Image } from "semantic-ui-react";

export default () => {
  return (
    // <div>

    // </div>

    <Grid divided="vertically">
      <Grid.Row columns={1}>
        <Grid.Column>
          <div className="message">
            <div className="message-title">Chat message</div>
            <ul style={{ padding: "0", margin: "0" }}>
              <li></li>
              <li>Nina</li>
              <li>Cursor</li>
            </ul>
          </div>
        </Grid.Column>
      </Grid.Row>
    </Grid>
  );
};
